import React, { Component } from "react";
import "./PersonList.css"



class PersonList extends Component {
  render() {
    return (
      <div>
        <button className="btn btn-outline-secondary" onClick={this.props.onAddPerson}>Add Person</button>
        <button className="btn btn-outline-secondary" onClick={this.props.onDeletePerson}>Delete Person</button>

        <div className="">{this.props.people}</div>
      </div>
    );
  }
}

export default PersonList;
